import './App.css';
import * as React from "react";
import {Route, Link, Routes, useNavigate} from 'react-router-dom';
import Page1 from './adpage1';
function App() {
  const navigate = useNavigate();
	const clickHandler = () => {
		navigate(<Page1/>);
	}
  return (
    <>
			<button onClick={clickHandler}>Go to product</button>	
		<p>About Page</p>
		</>
  );
}
export default App
